import React from "react";
import { NavLink, Link } from "react-router-dom";
import "./Navpar.css";

export default function Navpar() {
  return (
    <div>
      <div className="list">
        <ul>
          <li>
            <NavLink to={"/"}>HOME</NavLink>
          </li>
          <li>
            <NavLink to={"/about"}>About</NavLink>
          </li>
          <li>
            <NavLink to={"/tail"}>TailWindCss</NavLink>
          </li>
        </ul>
      </div>
    </div>
  );
}
